import React, { useState, useEffect } from 'react'

const UsersListing = () => {
    const [data, setData] = useState(null);

    useEffect( ()=> {
        fetch('https://dummyjson.com/users').then((result)=>{
            result.json().then(res => {
                console.log(res.users)
                setData(res.users)
            })
        })
    }, [])

  return (
    <div>
      <h1>User Listing</h1>
    </div>
  )
}

export default UsersListing
